    return (
        <i className="fa fa-facebook" aria-hidden="true" />
    )
}

export const info = {
    firstName: "John",
    initials: "js",
    position: "Full Stack Developer",
    selfPortrait: self,
    gradient: `linear-gradient(135deg, ${colors})`,
    miniBio: [
        ["☕️", "Fueled by coffee"],
        ["🇺🇸", "Based in the US"],
        ["💼", "Systems Engineer at Google"],
        ["✉️", "johnsmith@gmail.com"],
    ],
    socials: [
        ["https://facebook.com/", facebookIcon],
